const state = {
	cyclists: cyclists,
	searchField: '',
}

class App extends React.Component {
	render() {	
		return (
			<div className="near-black bg-washed-green">
				<h1 className='tc ttu'>Cycling Greats</h1>
				<SearchBox />
				<Cardlist cyclists={cyclists} />
			</div>
		)
	}
}

export default App
